ジャッキアップ・車の移動不要。取り付け簡単30秒！<div class="Zaiko">※数量限定品です。<BR>万一品切れの際はご容赦ください。</div><div class="Merit"><b>＜特長＞</b><p>●接地面にもう一つのリンク「補強リンク」を採用し、あらゆる路面状況において高い走破性を発揮。●左右非対称の亀甲パターンを採用し、横揺れ・横滑りを防ぎ、乗り心地の向上を実現。●ジャッキアップ・車の移動不要。全ての作業がタイヤの前面で出来る為、簡単に装着することが可能。●マジックテンションがチェーンのズレや緩みをなくし、走行している間にベストなポジションへ移動。チェーン装着後の面倒なまし締めが不要。</p></div><div class="Spec"><b>＜仕様＞</b><p>［ご使用方法］<br>1．タイヤチェーンは自動車が雪や氷上を安全に走行するための製品です。その目的以外には使用しないでください。<br>2．取扱いに際しては、取扱説明書に従って慎重に行ってください。またいざという時慌てないように実際に使用する前に雪のないところで事前装着を行ってください。<br>3．タイヤメーカー指定の空気圧に設定してください。空気圧が不足の場合、タイヤの種類によってはタイヤ側面にチェーンの装着跡がつくことがあります。<br>4．タイヤチェーン装着後は50Km（クイックランナー［NC］、セーフティランナ［NS］は30Km）以下で走行してください。<br>5．チェーンが切れた場合は即取り外して必要な修理を行ってください。そのまま使用するとボディーなどへ損傷を招くことになります。<br>6．一度使用したチェーンは、摩耗状態を確認の上使用してください。<br>［保管方法］<br>1．使用後は、湯水でチェーンについた凍結防止剤やドロなどをキレイに洗い落とし、十分に乾燥させてからサビ防止剤などを塗布して保管してください。<br></p></div><style type="text/css"><!--
